import React from 'react';
import GenericForm from './GenericForm';
import { ParametroCamposModel } from './Models/ParametroCamposModel';

export default function ParametroCamposForm() {

    return (<GenericForm
        formName='ParametroCampos'
        service='parametro-campos'
        model={ParametroCamposModel}
        successRedirect='/ParametroCampos'
    />
    );
};
